INSERT INTO my_about VALUES ('5','Introduction to the Site','<p style=\"text-align:left;\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;font-size:18pt;\"> <span style=\"color:#337FE5;\"> </span> <span style=\"color:#4C33E5;font-size:24px;font-family:Tahoma;\"> </span></span></b> \r\n</p>\r\n<p>\r\n	<b><b><span style=\"font-size: 18pt; color: rgb(76, 51, 229);\" color:#4c33e5;\"=\"\">Introduction to Ezi2u.com.my</span></b><span> </span> </b> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:13.5pt;font-family:\" color:#000000;\"=\"\">Ezi2u.com\r\nprovides vast amount of information about&nbsp;almost everything in life such\r\nas restaurant, holiday, entertainment and banks for users from all parts of Malaysia. Searching,</span><span> </span><span style=\"font-size:13.5pt;font-family:\" color:#000000;\"=\"\">viewing, navigating and\r\nposting information(including affiliated phone number) as well as vouchers <br />\r\n</span></b> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:13.5pt;font-family:\" color:#000000;\"=\"\">are\r\nfor free with our platforms on PC as well as portable digital devices (Cell\r\nphone, Ipad, etc.). </span> </b> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:13.5pt;font-family:;\"><span style=\"color:#666666;\"> In\r\naddition, sellers are able to register to enjoy </span><span style=\"color:#CC33E5;\">a\r\nunique free shop page <span style=\"color:#00D5FF;\">featuring</span></span> <span style=\"color:#00D5FF;\">http://www.ezi2u.com.my/memberID</span><span style=\"color:#CC33E5;\"> for easier</span></span><span style=\"font-size:13.5pt;font-family:\" color:#cc33e5;\"=\"\"> access</span><span style=\"font-size:13.5pt;font-family:\" color:#000000;\"=\"\"> as well as free services on posting\r\nvouchers. We have also a number of advertisement spaces covering nearly\r\nany area on our web page for <br />\r\n</span></b> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:13.5pt;font-family:\" color:#000000;\"=\"\">sellers to put imaged ads.</span><span> </span> </b> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<span style=\"font-size:18px;font-family:Tahoma;\"></span> \r\n</p>\r\n<p style=\"text-align:left;\" align=\"left\">\r\n	<br />\r\n<span style=\"font-size:18px;font-family:Tahoma;\"></span><b><span style=\"color:red;font-size:12pt;\"></span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18pt;\"> <strong><span style=\"color:#4C33E5;font-size:24px;font-family:Tahoma;\">Instruction on Costs and</span><span style=\"color:#4C33E5;\"> </span><span style=\"color:#4C33E5;font-size:24px;font-family:Tahoma;\"> Earnings for Members</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18pt;\"><strong><span style=\"color:#4C33E5;font-size:18px;\"></span></strong></span><span style=\"font-family:Tahoma;\"></span><br />\r\n<b><span style=\"color:#000000;font-size:18px;font-family:Tahoma;\"><span style=\"color:#666666;\">1. Earning Scores and Coins</span><br />\r\n</span></b> \r\n</p>\r\n<span style=\"font-size:18px;\">(1) Upon registration (either as individual or as seller member), a registered member will be ranked Visitor and awarded 10 scores and 20 coins;</span><br />\r\n<p>\r\n	<span style=\"font-size:18px;\">(2) Upon successful posting of either a post or a voucher, a registered member earns 2 scores;</span> \r\n</p>\r\n<span style=\"font-size:18px;\">(3) Upon each successful log-in, a registered member earns 1 score;</span><br />\r\n<span style=\"font-size:18px;\">(4) Upon passing verification of either the ID or the Business Licence, a registered member earns 10 scores;</span><br />\r\n<span style=\"font-size:18px;\">(5) 10 scores can be exchanged for a coin;</span><br />\r\n<p>\r\n	<span style=\"font-size:18px;\">(6) Members\' coins can be used for payment for services of the site;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">(7) 1 RM can purchase 1 coin, and registered member can log-in and purchase coins online (This function is yet to complete, and now members can <br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"> contact us via phone to purchase coins);</span> \r\n</p>\r\n<span style=\"font-size:18px;\">(8) Members\' coins cannot be exchanged for RM. </span><br />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n<b><span style=\"font-size:18px;font-family:Tahoma;\">2. Coin Consumption</span></b><br />\r\n<span style=\"font-size:12pt;\"> <strong> </strong><strong><span style=\"font-size:18px;font-family:Tahoma;\">1) Costs for Member Rank Upgrading</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;font-family:Tahoma;\">From <span style=\"font-size:18px;font-family:Tahoma;\">Visitor</span> to Gold Member:</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span><span style=\"font-size:18px;font-family:Tahoma;\"> <span>For 1 month:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;3 coins;</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;font-family:Tahoma;\"></span><span style=\"font-size:18px;font-family:Tahoma;\"></span><span style=\"font-size:18px;font-family:Tahoma;\"></span><span style=\"font-size:18px;\">For 6 months:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 16 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;\">For 1 year:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;\">Permanently:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 188 coins.</span><br />\r\n<br />\r\n<b><span style=\"font-size:18px;font-family:Tahoma;\"><span style=\"font-size:18px;font-family:Tahoma;\">2) Costs on Modifying Posts:</span></span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">Place at the Top of the Homepage:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 4 Coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">Place at the Top of the Broad Headings:&nbsp;&nbsp; 2 coins;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\">Place at the Top of the Sub-headings: &nbsp;&nbsp;&nbsp;&nbsp; 1 coin;</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"><span>Reddening/Over-striking Post Title:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 coin;</span><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span><span style=\"font-size:18px;\">Refreshing:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 coin.</span> \r\n</p>\r\n<span style=\"font-size:18px;\"></span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:18px;\"></span> <b><span style=\"font-size:18px;font-family:Tahoma;\"><span style=\"font-size:18px;font-family:Tahoma;\"></span></span></b> \r\n</p>\r\n<p>\r\n	<br />\r\n<span> <span style=\"font-family:Tahoma;font-size:18px;\"></span></span> <b><span style=\"font-size:15pt;\"></span></b><span></span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:15pt;\"> <span style=\"color:#003399;\"> </span><span style=\"color:#4C33E5;font-size:24px;font-family:Tahoma;\">Rights of Registered Members&nbsp; on Ezi2u.com</span></span></b><br />\r\n<br />\r\n<span style=\"font-size:12pt;\"><strong><span style=\"font-size:18px;font-family:Tahoma;\"> 1)</span></strong><strong> </strong><strong><span style=\"color:#009900;font-size:18px;font-family:Tahoma;\">Visitor:</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"><strong><span style=\"font-size:14px;\"></span></strong><b><span style=\"font-size:18px;font-family:Tahoma;\"> free posting &amp; managing posts, </span></b><span style=\"font-size:18px;font-family:Tahoma;\">choice of topping &amp; refreshing posts,</span><b><span style=\"font-size:18px;font-family:Tahoma;\"> earning scores upon posting &amp; logging-in;</span></b></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12pt;\"><b><span style=\"font-size:18px;font-family:Tahoma;\"></span></b></span><br />\r\n<span style=\"font-size:12pt;\"><strong><span style=\"font-size:18px;font-family:Tahoma;\">2</span></strong></span><strong><span style=\"color:#009900;font-size:18px;font-family:Tahoma;\"><span style=\"color:#000000;\">)</span> Gold Member</span><span style=\"color:#009900;font-size:18px;font-family:Tahoma;\">:</span></strong> \r\n</p>\r\n<span style=\"font-size:12pt;\"> \r\n<p>\r\n	<strong><span style=\"color:#000000;font-size:14px;\"></span></strong><span style=\"font-size:18px;font-family:Tahoma;\">free posting &amp; managing posts,</span><b> </b><span style=\"font-size:18px;font-family:Tahoma;\">choice of topping &amp; refreshing posts,</span><b><span style=\"font-size:18px;font-family:Tahoma;\"> shop page (for sellers), </span></b><span style=\"font-size:18px;font-family:Tahoma;\">choice of uploading information for shop page such as images,</span><strong><span style=\"font-size:18px;font-family:Tahoma;\"> free posting about vouchers, earning scores upon posting &amp; logging-in.</span></strong> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:18pt;font-family:宋体;color:#4C33E5;\"><strong><span style=\"font-size:12pt;\"><b><span style=\"font-size:24px;\"><span style=\"color:#4C33E5;font-size:24px;\">EZI2U</span></span></b><b><span style=\"font-size:24px;font-family:宋体;color:#4C33E5;\">说明</span></b></span></strong></span><span style=\"font-size:18.0pt;font-family:宋体;\"><span style=\"color:#4C33E5;\"><strong></strong></span></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span> </span><b><span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"color:#000000;\"><br />\r\n</span></span></b> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<b><span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"color:#666666;\">Ezi2u.com</span><span style=\"color:#666666;\">免费</span></span></b><span style=\"font-size:12pt;font-family:宋体;color:#666666;\">为</span><b><span style=\"font-size:12pt;color:#666666;\">MALAYSIA</span></b><span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"color:#666666;\">用户提供</span><b><span style=\"color:#EE33EE;\">各类生活信</span><span style=\"color:#EE33EE;\">息（如如餐饮、度假、娱乐及银行等）</span></b></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\"><b><span style=\"color:#EE33EE;\">的定位周边资讯查找、导航、电话、优惠券销售等服务</span><span style=\"color:#000000;\">，<span style=\"color:#EE33EE;\">商家注册后免费</span></span><span style=\"color:#00D5FF;\"><span style=\"color:#00D5FF;\"><span style=\"color:#00D5FF;\">送独立域名的主页</span></span></span></b></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\"><b><span style=\"color:#00D5FF;\"><span style=\"color:#00D5FF;\"><span style=\"color:#00D5FF;\"></span></span></span><span style=\"color:#EE33EE;\">和优惠券发</span><span style=\"color:#000000;\"><span style=\"color:#EE33EE;\">布</span><span style=\"color:#666666;\">，页面任何位置可投放图像广告。</span></span></b></span><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:15.0pt;\"><span style=\"color:#4C33E5;\"><strong>EZI2U</strong></span></span><span style=\"font-size:15pt;font-family:宋体;color:#4C33E5;\"><strong>会员消费和积分说明</strong></span> \r\n</p>\r\n<p>\r\n	<span> </span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\">1,</span><b><span style=\"font-size:12.0pt;font-family:宋体;\">积分、金币获得</span></b><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">）注册个人或商家会员</span><span style=\"font-size:12.0pt;\">,</span><span style=\"font-size:12.0pt;font-family:宋体;\">初始均为访客身份</span><span style=\"font-size:12.0pt;\">,</span><span style=\"font-size:12.0pt;font-family:宋体;\">注册送积分</span><span style=\"font-size:12.0pt;\">10</span><span style=\"font-size:12.0pt;font-family:宋体;\">分，送金币</span><span style=\"font-size:12.0pt;\">20</span><span style=\"font-size:12.0pt;font-family:宋体;\">个；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:23.25pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;\">）注册会员成功发布一条信息或<span style=\"color:#000000;\">一个优惠券</span>的，获积分</span><span style=\"font-size:12.0pt;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;\">分</span><span style=\"font-size:12.0pt;\"> </span><span style=\"font-size:12.0pt;font-family:宋体;\">；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:23.25pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">3</span><span style=\"font-size:12.0pt;font-family:宋体;\">）注册会员成功登陆一次会员账户，获积分</span><span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">分</span><span style=\"font-size:12.0pt;\"> </span><span style=\"font-size:12.0pt;font-family:宋体;\">；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:23.25pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">4</span><span style=\"font-size:12.0pt;font-family:宋体;\">）注册会员通过商家执照或个人身份认证的，获积分</span><span style=\"font-size:12.0pt;\">10</span><span style=\"font-size:12.0pt;font-family:宋体;\">分</span><span style=\"font-size:12.0pt;\"> </span><span style=\"font-size:12.0pt;font-family:宋体;\">；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">5</span><span style=\"font-size:12.0pt;font-family:宋体;\">）积分</span><span style=\"font-size:12.0pt;\">10</span><span style=\"font-size:12.0pt;font-family:宋体;\">分可以换一个金币；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">6</span><span style=\"font-size:12.0pt;font-family:宋体;\">）会员的金币可以在网站内消费；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">7</span><span style=\"font-size:12.0pt;font-family:宋体;\">）一个马币可以买一个金币，会员登陆后可以自己通过网上支付购买金币（暂未开通，目前支持客服电话服务购买）；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">（</span><span style=\"font-size:12.0pt;\">8</span><span style=\"font-size:12.0pt;font-family:宋体;\">）会员金币不可以兑换成马币；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"> </span> \r\n</p>\r\n<p style=\"text-indent:24.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"> </span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"> </span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;\">，<b>金币消费</b></span><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<p style=\"text-indent:30.1pt;\">\r\n	<b><span style=\"font-size:12.0pt;\">1</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;\">）升级消费</span></b><span style=\"font-size:12.0pt;font-family:宋体;\">：可以自己消费金币升级为黄金会员。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"text-indent:48.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">访客升级为黄金会员：</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"><span> </span><span></span><span></span>1</span><span style=\"font-size:12.0pt;font-family:宋体;\">个月</span><span style=\"font-size:12.0pt;\"> </span><span style=\"font-size:12.0pt;font-family:宋体;\">消费</span><span style=\"font-size:12.0pt;\"> <span> </span><span> </span><span>3</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"><span> </span><span></span>6</span><span style=\"font-size:12.0pt;font-family:宋体;\">个月</span><span style=\"font-size:12.0pt;\"> </span><span style=\"font-size:12.0pt;font-family:宋体;\">消费</span><span style=\"font-size:12.0pt;\"><span> </span>16</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"margin-left:52.5pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span></span><span></span><span></span>1</span><span style=\"font-size:12.0pt;font-family:宋体;\">年</span><span style=\"font-size:12.0pt;\"><span> </span></span><span style=\"font-size:12.0pt;font-family:宋体;\">消费</span><span style=\"font-size:12.0pt;\"><span> </span>30</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span><span style=\"font-size:12.0pt;\"><span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\"><br />\r\n</span> \r\n</p>\r\n<p style=\"margin-left:52.5pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">永久</span><span style=\"font-size:12.0pt;\"><span> </span></span><span style=\"font-size:12.0pt;font-family:宋体;\">消费</span><span style=\"font-size:12.0pt;\"> <span>188</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"><span> </span></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"><span> </span><b><span> </span>2</b></span><b><span style=\"font-size:12.0pt;font-family:宋体;\">）</span></b><b><span style=\"font-size:12.0pt;\"> </span></b><b><span style=\"font-size:12.0pt;font-family:宋体;\">信息处理消费：</span></b><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<p style=\"margin-left:48.0pt;text-indent:-36.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span>（1）<span> </span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\">首页置顶，消费</span><span style=\"font-size:12.0pt;\">4</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"margin-left:48.0pt;text-indent:-36.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span>（2）<span> </span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\">大类置顶，消费</span><span style=\"font-size:12.0pt;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"margin-left:48.0pt;text-indent:-36.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span>（3）<span> </span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\">小类置顶，消费</span><span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"margin-left:48.0pt;text-indent:-36.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span>（4）<span> </span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\">标题套红，加粗，消费</span><span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p style=\"margin-left:48.0pt;text-indent:-36.0pt;\">\r\n	<span style=\"font-size:12.0pt;\"><span>（5）<span> </span></span></span><span style=\"font-size:12.0pt;font-family:宋体;\">信息刷新，消费</span><span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">个金币。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<span></span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:15pt;color:#4C33E5;\"><strong>EZI2U</strong></span><span style=\"font-size:15pt;font-family:宋体;color:#4C33E5;\"><strong>注册会员权利</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"> </span> \r\n</p>\r\n<p style=\"margin-left:60.0pt;text-indent:-60.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"color:#009900;\"><strong>访客会员</strong></span>：<b>发布管理信息免费</b>。自行操作信息置顶和刷新，<b>获得信息发布、网站登陆等积分。</b></span><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:12.0pt;\"> </span> \r\n</p>\r\n<p style=\"margin-left:60.0pt;text-indent:-60.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\"><span style=\"color:#009900;\"><strong>黄金会员</strong></span>：发布管理信免费息。自行操作信息置顶和刷新，<b>开通商家独立域名主页(仅限商家用户)</b>，可以自己</span> \r\n</p>\r\n<p style=\"margin-left:60.0pt;text-indent:-60.0pt;\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\"> 上传商家照片等信息资料，<b>免费发布有<span style=\"color:#000000;\">关优惠券信息</span></b>。<b>获得信息发布、网站登陆等积分。</b></span> \r\n</p>\r\n<p style=\"margin-left:60.0pt;text-indent:-60.0pt;\">\r\n	<br />\r\n<span style=\"font-size:12.0pt;font-family:宋体;\"><b></b></span><b><span style=\"font-size:12.0pt;\"></span></b> \r\n</p>\r\n<strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"></span></strong> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<strong><span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"><br />\r\n</span></strong> \r\n</p>\r\n<b> \r\n<p>\r\n	<span style=\"font-size:12pt;\"> </span> \r\n</p>\r\n<p>\r\n	<span style=\"line-height:1;font-size:18px;font-family:Tahoma;\"> <span style=\"color:#EE33EE;line-height:1;font-size:18px;font-family:Tahoma;\">P</span></span><span style=\"color:#EE33EE;line-height:1;font-size:18px;font-family:Tahoma;\">lease Note: Due to the fact that we are consistently bettering ourselves, all terms shown in this introduction may subject</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#EE33EE;line-height:1;font-size:18px;