INSERT INTO my_about VALUES ('6','Introduction to Advertise','<span style=\"color:#4C33E5;font-size:24px;\"><b><span style=\"font-size:12pt;\"> \r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Dear\r\n users, our site helps you find and post information concerning almost \r\neverything in your life, a</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">ll free of charge, and we also have free shop \r\npage, product display and ordering service in store especially </span></span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">for \r\nregistered seller members!</span></span><span style=\"font-family:宋体;font-size:12pt;\"></span> \r\n</p>\r\n<p>\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In order to express our gratitude to those who registered, all registered users (members) will receive </span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;font-family:Times New Roman;font-size:16px;background-color:#FFFFFF;\">a gift of 20 coins once the registration is complete. (It takes 1 RM to buy 1 Coin)</span> \r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>\r\n</b> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n</span> \r\n<p>\r\n	<br />\r\n</p>','2','0','2','Introduction-to-Advertise');
