INSERT INTO my_information VALUES ('1685','21 Sizzling / Grill','289','1448597149','0','0','这家烧烤店主要是吃一般的鸡排、羊排、以及猪扒！但，不得不介绍的是这里的黄金咸蛋猪扒(RM18.90)超大一块的，这里的咸蛋酱是放起司下去烹煮的，特别咸香带点微甜，猪扒还很juicy呢，还有超多的薯条，还贴心的撒上香料，煞是美味可口。还有还有！！！起司猪肉汉堡（RM15.90)，肉厚厚的一层，起司都留出来了，加上大大一颗太阳蛋，一口是完全咬不下去的说。<br />\r\n老板推荐这里的果汁，而且还有XL版的哟（RM10.90)，真的超大一瓶的。这里的mocha（RM7.90)也要试试哦，味道甚是特别也很好喝哦。这铁板老虎虾烤羊扒（RM21.90）超赞的，老板有说羊肉是羊的肩膀再下一点，所以肉质甜美鲜嫩，配上特制的酱料，香辣提味，完全提升了羊肉的味道。怕羊骚味的朋友大可放心，酱料给它一沾下去，完全爆在口腔内啊。那只老虎虾很鲜甜哟！<br />\r\n	<br />\r\nOpen&nbsp;·&nbsp;12:00–23:00','','03-7971 11','','','03-7971 1105','0','3','0','e10adc3949ba59abbe56e057f20f883e','219.92.255.4','马来西亚','1','/attachment/information/201511/pre_1448597149cmmgd.jpg','2','1','0','1','0','0','0','0','Western','Western','1','0','','21 JALAN KUCHAI MAJU 7, 58200 Kuala Lumpur, Malaysia','4','233','0');
