INSERT INTO my_information VALUES ('2543','Old China Cafe','285','1452844963','0','0','Hours:&nbsp;Sun&nbsp;-&nbsp;Sat&nbsp;11:00&nbsp;-&nbsp;23:00<br />\r\n<br />\r\nOld&nbsp;China&nbsp;Cafe&nbsp;was&nbsp;a&nbsp;little&nbsp;gem&nbsp;we&nbsp;found&nbsp;after&nbsp;a&nbsp;recommendation&nbsp;from&nbsp;a&nbsp;friend.&nbsp;It&nbsp;was&nbsp;a&nbsp;little&nbsp;off&nbsp;the&nbsp;main&nbsp;area&nbsp;of&nbsp;Chinatown&nbsp;and&nbsp;as&nbsp;we&nbsp;made&nbsp;our&nbsp;way&nbsp;towards&nbsp;it,&nbsp;we&nbsp;almost&nbsp;turned&nbsp;away&nbsp;thinking&nbsp;it&nbsp;was&nbsp;closed.&nbsp;I&nbsp;am&nbsp;so&nbsp;glad&nbsp;that&nbsp;we&nbsp;didn\'t!<br />\r\nPushing&nbsp;our&nbsp;way&nbsp;through&nbsp;the&nbsp;old&nbsp;American&nbsp;saloon&nbsp;style&nbsp;doors&nbsp;we&nbsp;made&nbsp;our&nbsp;way&nbsp;into&nbsp;a&nbsp;small&nbsp;restaurant&nbsp;with&nbsp;a&nbsp;very&nbsp;homey&nbsp;cosy&nbsp;feel.&nbsp;<br />\r\nThe&nbsp;food&nbsp;itself&nbsp;was&nbsp;very&nbsp;good,&nbsp;great&nbsp;starters,&nbsp;and&nbsp;I&nbsp;thoroughly&nbsp;enjoyed&nbsp;the&nbsp;Beef&nbsp;Rendang&nbsp;-&nbsp;very&nbsp;much&nbsp;a&nbsp;highlight&nbsp;for&nbsp;me.&nbsp;Although&nbsp;the&nbsp;chicken&nbsp;dish&nbsp;was&nbsp;also&nbsp;flavoured&nbsp;well&nbsp;with&nbsp;a&nbsp;good&nbsp;amount&nbsp;of&nbsp;spice.<br />\r\nThe&nbsp;alcohol&nbsp;on&nbsp;the&nbsp;menu&nbsp;wasn\'t&nbsp;cheap,&nbsp;but&nbsp;I&nbsp;enjoyed&nbsp;the&nbsp;juices,&nbsp;especially&nbsp;the&nbsp;soursop.<br />\r\nA&nbsp;very&nbsp;good&nbsp;evening&nbsp;overall&nbsp;with&nbsp;no&nbsp;pressure&nbsp;to&nbsp;eat&nbsp;and&nbsp;move&nbsp;on,&nbsp;it&nbsp;was&nbsp;nice&nbsp;to&nbsp;relax&nbsp;and&nbsp;chat&nbsp;afterwards.','','Old China','','','+603-207-25915','0','0','0','e10adc3949ba59abbe56e057f20f883e','175.139.249.44','马来西亚吉隆坡','1','/attachment/information/201601/pre_1452844963l1aul.png','2','1','0','1','0','0','0','0','Chinese','Chinese','1','0','','11 Jalan Balai Polis, 50000 Kuala Lumpur','4','230','0');
